import React from "react";
import { FaCreativeCommonsBy } from "react-icons/fa";
import {FiShoppingCart} from "react-icons/fi";
import {Link} from "react-router-dom";


const Style=()=>{
color:'black';

}

const Navbar =()=>{
return(
  <div className="parent">

    <div className="child-1">
    <h1>TechShed</h1>
    <button> Get 15% off your first purchase </button>
  </div>


  <div className="child-2">
      <ul>
    <Link to="/" style={Style}> <li>Home</li></Link>
    <Link to="/cart"><li>Products</li></Link>
    <Link to="/cart"><li>Cards</li></Link>
    <Link to="/">  <li>Contact</li></Link>
      </ul>

      <button className="btn-1"> <FaCreativeCommonsBy size="2em" className="icon-1" />log in</button>
      <button className="btn-2"><FiShoppingCart size="2em"/></button>
  </div>
</div>
);
}
export default Navbar;
